import { useState } from "react";
import "./App.css";

function App() {
  // 최초값으로 객체로 이루어진 배열을 넣어야함
  const [todos, setTodos] = useState(initialState);
  return (
    <>
      <header style={{ textAlign: "center" }}>
        <h1>My Todo List</h1>
      </header>
      <main>
        <section
          style={{
            border: "1px solid black",
            padding: "30px",
            backgroundColor: "#eee",
          }}
        >
          {" "}
          제목 <input placeholder="제목을 입력해주세요" />
          내용 <input placeholder="내용을 입력해주세요" />
          <button
            style={{
              backgroundColor: "cornflowerblue",
              color: "white",
              padding: "5px 30px",
              borderRadius: "7px",
              marginLeft: "850px",
            }}
          >
            추가하기
          </button>
        </section>
        TodoList가 들어갈 곳(Done)
        <section style={{ display: "flex", margin: "20px", gap: "10px" }}>
          {todos.map((item) => {
            return (
              <div style={{ backgroundColor: "cornflowerblue" }}>
                <h4>{item.title}</h4>
                <p>{item.contetns}</p>
              </div>
            );
          })}
        </section>
        <section>TodoList가 들어갈 곳(Done)</section>
      </main>
      <footer>footer 영역입니다.</footer>
    </>
  );
}
const initialState = [
  {
    title: "제목1",
    contetns: "내용1",
    isDone: false,
    id: 1,
  },
  {
    title: "제목2",
    contetns: "내용2",
    isDone: false,
    id: 2,
  },
  {
    title: "제목3",
    contetns: "내용3",
    isDone: false,
    id: 3,
  },
];
export default App;
